def process_graph_spec(spec, output_path='/mnt/data/graph.png'):
    """
    Given a spec dict or a string (JSON or Python literal), builds a directed NetworkX graph,
    prints summary, details, and saves a visualization as a PNG.
    
    Parameters
    ----------
    spec : dict or str
        Specification containing:
          - node_kwargs_list: list of node entries (dicts, pairs, or list-of-dicts)
          - edge_kwargs_list: list of edge entries (dicts, pairs, or list-of-dicts)
        Can be passed as a dict, a JSON string, or a Python dict literal string.
    output_path : str
        Path to save the graph image (PNG).
    
    Returns
    -------
    nx.DiGraph
        The constructed directed graph.
    """
    # Parse spec if it's a string
    if isinstance(spec, str):
        try:
            spec_dict = json.loads(spec)
        except json.JSONDecodeError:
            spec_dict = ast.literal_eval(spec)
    elif isinstance(spec, dict):
        spec_dict = spec
    else:
        raise TypeError(f"Spec must be dict or string, got {type(spec)}")
    
    def flatten_list_of_lists(lst):
        if lst and isinstance(lst[0], list):
            return [item for sublist in lst for item in sublist]
        return lst
    
    data['node_kwargs_list'] = flatten_list_of_lists(spec_dict.get('node_kwargs_list', []))
    data['edge_kwargs_list'] = flatten_list_of_lists(spec_dict.get('edge_kwargs_list', []))

    def to_dict(entry):
        if isinstance(entry, dict):
            return entry
        if isinstance(entry, list) and all(isinstance(x, (list, tuple)) and len(x) == 2 for x in entry):
            return dict(entry)
        if isinstance(entry, list) and all(isinstance(x, dict) and len(x) == 1 for x in entry):
            merged = {}
            for d in entry:
                merged.update(d)
            return merged
        raise TypeError(f"Unsupported entry type/format: {entry!r}")
    
    # Build graph
    G = nx.DiGraph()
    for nk in spec_dict.get('node_kwargs_list', []):
        nkd = to_dict(nk)
        G.add_node(nkd['id'], **nkd)
    for ek in spec_dict.get('edge_kwargs_list', []):
        ekd = to_dict(ek)
        G.add_node(ekd['id'], **ekd)
        G.add_edge(ekd['src_node'], ekd['id'])
        G.add_edge(ekd['id'], ekd['dest_node'])
    
    # Print summary
    print(f"DiGraph with {G.number_of_nodes()} nodes and {G.number_of_edges()} edges")
    print("\nNodes and attributes:")
    for nid, attrs in G.nodes(data=True):
        print(f"  {nid}: {attrs}")
    print("\nEdges:")
    for src, dst in G.edges():
        print(f"  {src} â†’ {dst}")
    print("\nAdjacency list:")
    for line in nx.generate_adjlist(G):
        print(" ", line)
    
 
    print(f"\nSaved graph image to {output_path}")
    return G


def build_graph_from_spec(spec):
    """
    Build a NetworkX DiGraph from a flexible spec input:
      - list of dicts  -> single chain inferred
      - list of list of dicts -> parallel chains
      - dict with node_kwargs_list & optional edge_kwargs_list
      - str of any above (JSON or Python literal)

    Returns
    -------
    networkx.DiGraph
    """
    # Parse spec if string
    if isinstance(spec, str):
        try:
            data = json.loads(spec)
        except json.JSONDecodeError:
            data = ast.literal_eval(spec)
    else:
        data = spec

    # If top-level is a simple list of dicts -> wrap as node_kwargs_list
    if isinstance(data, list) and data and isinstance(data[0], dict):
        node_chains = [data]
        edge_chains = [[]]
    # If top-level is list of lists of dicts
    elif isinstance(data, list) and data and isinstance(data[0], list):
        node_chains = data
        edge_chains = [[] for _ in node_chains]
    # Else assume dict with explicit lists
    elif isinstance(data, dict):
        raw_nodes = data.get('node_kwargs_list', [])
        # Normalize node_chains
        if raw_nodes and isinstance(raw_nodes[0], dict):
            node_chains = [raw_nodes]
        else:
            node_chains = raw_nodes
        # Normalize edge_chains
        raw_edges = data.get('edge_kwargs_list', [])
        if raw_edges and isinstance(raw_edges[0], dict):
            edge_chains = [raw_edges]
        else:
            # match number of chains
            edge_chains = raw_edges if raw_edges else [[]]*len(node_chains)
    else:
        raise TypeError(f"Unsupported spec type: {type(data)}")

    # Handle common source/sink flags
    common_src = False
    common_snk = False
    if isinstance(data, dict):
        common_src = data.get('common_source', False)
        common_snk = data.get('common_sink', False)
    
    common_src = True
    common_snk = True
    G = nx.DiGraph()
    # Add shared source/sink
    if common_src:
        G.add_node('src')
    if common_snk:
        G.add_node('sink')

    # Helper to normalize entry to dict
    def to_dict(e):
        if isinstance(e, dict): return e
        if isinstance(e, list) and all(isinstance(x, dict) and len(x)==1 for x in e):
            merged = {}
            for d in e: merged.update(d)
            return merged
        raise TypeError(f"Unsupported entry: {e!r}")

    # Build each chain
    for i, nodes in enumerate(node_chains):
        src_label = 'src' if common_src else f'src_{i}'
        snk_label = 'sink' if common_snk else f'sink_{i}'
        if not common_src:
            G.add_node(src_label)
        if not common_snk:
            G.add_node(snk_label)

        # Add machine nodes
        ids = []
        for nk in nodes:
            attrs = to_dict(nk)
            print(attrs)
            node_id = attrs.pop('id')
            G.add_node(node_id, **attrs)
            ids.append(node_id)

        # Connect source -> first
        if ids:
            G.add_edge(src_label, ids[0])

        # Add buffers/edges if given
        buffers = edge_chains[i] if i < len(edge_chains) else []
        if buffers:
            for ek in buffers:
                attrs = to_dict(ek)
                buf_id = attrs.pop('id')
                src_node = attrs.pop('src_node')
                dst_node = attrs.pop('dest_node')
                G.add_node(buf_id, **attrs)
                G.add_edge(src_node, buf_id)
                G.add_edge(buf_id, dst_node)
        else:
            # Infer direct edges between machines
            for u, v in zip(ids, ids[1:]):
                G.add_edge(u, v)

        # Connect last -> sink
        if ids:
            G.add_edge(ids[-1], snk_label)

    return G


