def build_graph_from_spec_list(spec):
    """
    Build a NetworkX DiGraph from a spec that may be:
      - a dict with 'node_kwargs_list' & optional 'edge_kwargs_list'
      - a list of node dicts (single chain)
      - a list of list of node dicts (parallel chains)
      - any of the above as a JSON or Python-literal string

    The function simply adds each entry as a node (using its 'id') and
    then adds edges wherever an entry has:
      - 'src_node' + 'dest_node' (buffer semantics)
      - 'in_edges' list or 'out_edges' list (machine semantics)
    """
    # 1) Parse spec if needed
    if isinstance(spec, str):
        try:
            data = json.loads(spec)
        except json.JSONDecodeError:
            data = ast.literal_eval(spec)
    else:
        data = spec

    # 2) Extract node list(s)
    if isinstance(data, list) and data and isinstance(data[0], dict):
        node_chains = [data]
    elif isinstance(data, list) and data and isinstance(data[0], list):
        node_chains = data
    elif isinstance(data, dict):
        raw = data.get('node_kwargs_list', [])
        node_chains = ([raw] if raw and isinstance(raw[0], dict) else raw)
    else:
        raise TypeError(f"Unsupported spec type: {type(data)}")

    # 3) Build graph
    G = nx.DiGraph()

    def to_dict(e):
        if isinstance(e, dict):
            return e.copy()
        if isinstance(e, list) and all(isinstance(x, dict) and len(x)==1 for x in e):
            merged = {}
            for d in e: merged.update(d)
            return merged
        raise TypeError(f"Unsupported entry: {e!r}")

    for chain in node_chains:
        for entry in chain:
            attrs = to_dict(entry)
            print("nfkwfivefivbeibiebfiehbfiebfv",attrs)
            node_id = attrs.pop('id')
            # Add the node with any leftover attributes
            G.add_node(node_id, **attrs)

    # 4) Scan again to add edges
    for chain in node_chains:
        for entry in chain:
            attrs = to_dict(entry)
            node_id = attrs['id']

            # Buffer semantics
            if 'src_node' in attrs and 'dest_node' in attrs:
                G.add_edge(attrs['src_node'], node_id)
                G.add_edge(node_id, attrs['dest_node'])

            # Machine semantics
            for inc in attrs.get('in_edges', []):
                G.add_edge(inc, node_id)
            for outc in attrs.get('out_edges', []):
                G.add_edge(node_id, outc)

    return G



import networkx as nx


def networkx_to_blockdiag_dsl(G):
    """Turn G.edges() into a blockdiag DSL string."""
    lines = ["blockdiag {"]
    for u, v in G.edges():
        lines.append(f"  {u} -> {v};")
    lines.append("}")
    return "\n".join(lines)


def blockdiagdraw(diagram_definition):
    tree = blockdiag.parser.parse_string(diagram_definition)

    diagram = blockdiag.builder.ScreenNodeBuilder.build(tree)
    #blockdiag.imagedraw.png.ImageDrawEx.textsize = custom_textsize
     # Create a fontmap with larger font size
 

    # Draw the diagram to an image file
    #print("hola",tree)
    drawer = blockdiag.drawer.DiagramDraw('PNG', diagram, filename="diagram_for_factoryflow.png")
  
    drawer.draw()
    drawer.save()

def visualize_graph(data, output_path='graph.png'):
    #return 1
    #G= build_graph_from_spec(data)
    G= build_graph_from_spec_list(data)
    #sG= process_graph(data)
    blockdiag_dsl = networkx_to_blockdiag_dsl(G)
    blockdiagdraw(blockdiag_dsl)
    print(f"Graph visualization saved to {output_path}")



